import React from "react";
import Sidebar from "./Sidebar";
import Dashboard from "./Dashboard";

const UserDashboard = () => {
  return (
    <div>
      <div className="container-fluid" >
        <div className="row">
          <Sidebar />
          <Dashboard />
        </div>
      </div>
    </div>
  );
};

export default UserDashboard;
